-- ¿Cuántas facturas hubo en 2009 y 2011? ¿Cuáles son las ventas totales respectivas para cada uno de esos años?
select substr(InvoiceDate,1 ,4) as año, count(InvoiceId) as cantidad_de_facturas, sum(Total) as ventas_totales from invoices where InvoiceDate regexp '^2009' or InvoiceDate regexp '^2011' group by año;
/**
+------+----------------------+----------------+
| año  | cantidad_de_facturas | ventas_totales |
+------+----------------------+----------------+
| 2009 | 83                   | 449.46         |
| 2011 | 83                   | 469.58         |
+------+----------------------+----------------+
**/

