-- Proporciona una consulta que incluya el nombre de la pista comprada Y el nombre del artista con cada ítem de línea de factura.
select t.Name, ar.Name, ii.TrackId from tracks as t, invoice_items as ii, albums as al, artists as ar where t.TrackId = ii.TrackId and t.AlbumId = al.AlbumId and al.Artistid = ar.Artistid;
select t.Name, ar.Name, ii.TrackId from tracks as t join invoice_items as ii on t.TrackId=ii.TrackId join albums as al on t.AlbumId=al.AlbumId join artists as ar on al.Artistid=ar.Artistid;
